import{_ as a,o as r,c as s,b as i,d as n,e,a as d,r as o}from"./app.045d212c.js";var l="/aktivitaeten/BDM-2024-11/00_11-2024.png",m="/aktivitaeten/BDM-2024-11/01_11-2024.jpg",g="/aktivitaeten/BDM-2024-11/02_11-2024.jpg",u="/aktivitaeten/BDM-2024-11/03_11-2024.jpg",p="/aktivitaeten/BDM-2024-11/04_11-2024.jpg",c="/aktivitaeten/BDM-2024-11/05_11-2024.jpg",h="/aktivitaeten/BDM-2024-11/06_11-2024.jpg",_="/aktivitaeten/BDM-2024-11/07_11-2024.jpg",k="/aktivitaeten/BDM-2024-11/08_11-2024.jpg",v="/aktivitaeten/BDM-2024-11/09_11-2024.jpg",B="/aktivitaeten/BDM-2024-11/10_11-2024.jpg",M="/aktivitaeten/BDM-2024-11/11_11-2024.jpg",D="/aktivitaeten/BDM-2024-11/12_11-2024.jpg",b="/aktivitaeten/BDM-2024-11/13_11-2024.jpg",f="/aktivitaeten/BDM-2024-11/14_11-2024.jpg",w="/aktivitaeten/BDM-2024-11/15_11-2024.jpg",z="/aktivitaeten/BDM-2024-11/16_11-2024.jpg",j="/aktivitaeten/BDM-2024-11/17_11-2024.jpg",A="/aktivitaeten/BDM-2024-11/18_11-2024.jpg",S="/aktivitaeten/BDM-2024-11/19_11-2024.jpg",P="/aktivitaeten/BDM-2024-11/20_11-2024.jpg",E="/aktivitaeten/BDM-2024-11/21_11-2024.jpg",T="/aktivitaeten/BDM-2024-11/22_11-2024.jpg",K="/aktivitaeten/BDM-2024-11/23_11-2024.jpg",O="/aktivitaeten/BDM-2024-11/24_11-2024.jpg",N="/aktivitaeten/BDM-2024-11/25_11-2024.jpg",F="/aktivitaeten/BDM-2024-11/26_11-2024.jpg",L="/aktivitaeten/BDM-2024-11/27_11-2024.jpg",H="/aktivitaeten/BDM-2024-11/28_11-2024.jpg",W="/aktivitaeten/BDM-2024-11/29_11-2024.jpg",G="/aktivitaeten/BDM-2024-11/30_11-2024.jpg",R="/aktivitaeten/BDM-2024-11/31_11-2024.jpg",V="/aktivitaeten/BDM-2024-11/32_11-2024.jpg",Q="/aktivitaeten/BDM-2024-11/33_11-2024.jpg",I="/aktivitaeten/BDM-2024-11/34_11-2024.jpg",C="/aktivitaeten/BDM-2024-11/35_11-2024.jpg",U="/aktivitaeten/BDM-2024-11/36_11-2024.jpg",Z="/aktivitaeten/BDM-2024-11/37_11-2024.jpg",q="/aktivitaeten/BDM-2024-11/38_11-2024.jpg",x="/aktivitaeten/BDM-2024-11/39_11-2024.jpg",y="/aktivitaeten/BDM-2024-11/40_11-2024.jpg",J="/aktivitaeten/BDM-2024-11/41_11-2024.jpg",Y="/aktivitaeten/BDM-2024-11/42_11-2024.jpg",X="/aktivitaeten/BDM-2024-11/43_11-2024.jpg",$="/aktivitaeten/BDM-2024-11/44_11-2024.jpg",ee="/aktivitaeten/BDM-2024-11/45_11-2024.jpg",ie="/aktivitaeten/BDM-2024-11/46_11-2024.jpg",te="/aktivitaeten/BDM-2024-11/47_11-2024.jpg",ne="/aktivitaeten/BDM-2024-11/48_11-2024.jpg",ae="/aktivitaeten/BDM-2024-11/49_11-2024.jpg",re="/aktivitaeten/BDM-2024-11/50_11-2024.jpg",se="/aktivitaeten/BDM-2024-11/51_11-2024.jpg",de="/aktivitaeten/BDM-2024-11/52_11-2024.jpg",oe="/aktivitaeten/BDM-2024-11/53_11-2024.jpg",le="/aktivitaeten/BDM-2024-11/54_11-2024.jpg",me="/aktivitaeten/BDM-2024-11/55_11-2024.jpg",ge="/aktivitaeten/BDM-2024-11/56_11-2024.jpg",ue="/aktivitaeten/BDM-2024-11/57_11-2024.jpg",pe="/aktivitaeten/BDM-2024-11/58_11-2024.jpg",ce="/aktivitaeten/BDM-2024-11/59_11-2024.jpg",he="/aktivitaeten/BDM-2024-11/60_11-2024.jpg",_e="/aktivitaeten/BDM-2024-11/61_11-2024.jpg",ke="/aktivitaeten/BDM-2024-11/62_11-2024.jpg",ve="/aktivitaeten/BDM-2024-11/63_11-2024.jpg",Be="/aktivitaeten/BDM-2024-11/64_11-2024.png",Me="/aktivitaeten/BDM-2024-11/65_11-2024.jpg",De="/aktivitaeten/BDM-2024-11/66_11-2024.jpg",be="/aktivitaeten/BDM-2024-11/67_11-2024.jpg",fe="/aktivitaeten/BDM-2024-11/68_11-2024.jpg",we="/aktivitaeten/BDM-2024-11/69_11-2024.jpg",ze="/aktivitaeten/BDM-2024-11/70_11-2024.jpg",je="/aktivitaeten/BDM-2024-11/71_11-2024.jpg",Ae="/aktivitaeten/BDM-2024-11/72_11-2024.jpg",Se="/aktivitaeten/BDM-2024-11/73_11-2024.jpg",Pe="/aktivitaeten/BDM-2024-11/74_11-2024.jpg",Ee="/aktivitaeten/BDM-2024-11/75_11-2024.jpg",Te="/aktivitaeten/BDM-2024-11/76_11-2024.jpg",Ke="/aktivitaeten/BDM-2024-11/77_11-2024.jpg",Oe="/aktivitaeten/BDM-2024-11/78_11-2024.jpg",Ne="/aktivitaeten/BDM-2024-11/79_11-2024.jpg",Fe="/aktivitaeten/BDM-2024-11/80_11-2024.jpg",Le="/aktivitaeten/BDM-2024-11/81_11-2024.jpg",He="/aktivitaeten/BDM-2024-11/82_11-2024.jpg",We="/aktivitaeten/BDM-2024-11/83_11-2024.jpg",Ge="/aktivitaeten/BDM-2024-11/84_11-2024.jpg",Re="/aktivitaeten/BDM-2024-11/85_11-2024.jpg",Ve="/aktivitaeten/BDM-2024-11/86_11-2024.jpg",Qe="/aktivitaeten/BDM-2024-11/87_11-2024.jpg",Ie="/aktivitaeten/BDM-2024-11/88_11-2024.jpg",Ce="/aktivitaeten/BDM-2024-11/90_11-2024.jpg";const Ue={},Ze=i("h1",{id:"bilder-des-monats-november-2024",tabindex:"-1"},[i("a",{class:"header-anchor",href:"#bilder-des-monats-november-2024","aria-hidden":"true"},"#"),e(" Bilder des Monats November 2024")],-1),qe=e("DM5WK nutzte seinen Urlaub in D\xE4nemark um am 28.10.2024 als OZ/DM5WK mit der DF-Vertikalantenne auf dem 20-m-Band zwei Parks zu aktivieren: Zuerst "),xe={href:"https://pota.app/#/park/DK-0070",target:"_blank",rel:"noopener noreferrer"},ye=e("DK-0070 Bovbjergklinten Coastal Park"),Je=e(" und im Anschluss "),Ye={href:"https://pota.app/#/park/DK-0026",target:"_blank",rel:"noopener noreferrer"},Xe=e("DK-0026 Nissum Bredning Natura 2000"),$e=e(". Die Referenzen waren sehr begehrt, so dass nach jeweils knapp einer halben Stunde gut 30 Kontakte pro Park zustande kamen. Davon waren sechs Park2Park-Kontakte und mehrere DF2DF-Kontakte. Einige OPs schafften sogar eine Verbindung zu jedem der zwei Parks. Auf der Anfahrt zum ersten Spot hat es noch geregnet, aber schon kurz vor dem Aufbau wurde das Wetter \xFCber Nieseln bis Sonnenschein besser, wenn auch der kr\xE4ftige Wind blieb. Zum Gl\xFCck gab es auf den Nordseeklippen von DK-0070 eine windgesch\xFCtzte kleine Senke, in der TRX und OP ein wenig Schutz fanden. Die Antenne hatte weniger Schutz und schwankte hin und her. In der direkten Umgebung gab es einen Leuchtturm, Bunkeranlagen, K\xFChe, steile Klippen und die Nordsee. Auch ohne Funkausr\xFCstung w\xE4re das ein lohnenswerter Ausflug. Der zweite Park "),ei={href:"https://eunis.eea.europa.eu/sites/DK00CX028",target:"_blank",rel:"noopener noreferrer"},ii=e("Nissum Bredning"),ti=e(" ist mit 136 km\xB2 deutlich gr\xF6\xDFer. Am S\xFCdwestende in der N\xE4he des Gjeller S\xF8 ist eine kleinere \xDCberlappung mit einem Weidegebiet f\xFCr Schafe, die an dem Tag allerdings woanders grasten. Der Bereich eignet sich gut f\xFCr einen Funkstandort und es gab es auf dem Fu\xDFweg dorthin ein Kajak zu sehen. Auch hier ist eine sch\xF6ne Gegend f\xFCr einen Ausflug mit Spazierg\xE4ngen."),ni=d('<p><img src="'+l+'" alt="Bilder des Monats"><img src="'+m+'" alt="Bilder des Monats"><img src="'+g+'" alt="Bilder des Monats"><img src="'+u+'" alt="Bilder des Monats"></p><p>Heute k\xFCndigte sich wieder Inversion an,wie die letzten Tage auch.Und das nutzten wir,DF6TG und DL2HLD . Es ging an meinem freien Tag ausnahmsweise hoch zum qrl,auf 2224m. Mit der Seilbahn hoch bis zum Gipfel 2224m. Dort weiter zu Fu\xDF, Richtung Westen auf dem Grat entlang. Dort wurde dann mein guter alter FT-857 ausgepackt,und an einen EREMIT 12V ,12Ah angeschlossen. Als Antenne war eine 4 -Element LogPer auf 3m Mast montiert. Gearbeitet wurde ausschlie\xDFlich im 2m Band / SSB. Gespeist mit 5m RG-316. Locator war JN57EK. 30Watt waren es auf der Antenne. So kamen durch die H\xF6he und die Tropo Bedingungen 30 QSoO ins Log. Das weiteste QSO war heute in die Niederlande mit 723km Viele Verbindungen waren \xFCber der 500km Marke. Bis nach Belgien ging es problemlos mit 5/9. Alles in allem eine Hammer Aktion Der Blick ging von der Zugspitze bis zum S\xE4ntis,und weiter bis zu den Schweizer Gletschern. Verbindungen gingen von hier in Oberstdorf bis zur Nordseek\xFCste, Bremen, Hannover, L\xFCneburger Heide,K\xF6ln.....alles mit 5/9 und zum gr\xF6\xDFten Teil \xFCber 9</p><p><img src="'+p+'" alt="Bilder des Monats"><img src="'+c+'" alt="Bilder des Monats"><img src="'+h+'" alt="Bilder des Monats"><img src="'+_+'" alt="Bilder des Monats"><img src="'+k+'" alt="Bilder des Monats"><img src="'+v+'" alt="Bilder des Monats"><img src="'+B+'" alt="Bilder des Monats"><img src="'+M+'" alt="Bilder des Monats"><img src="'+D+'" alt="Bilder des Monats"><img src="'+b+'" alt="Bilder des Monats"></p><p>DF9HC auf Dienstreise in Kopenhagen. Jedem Olsenbanden-Fan ist Valby ein Begriff, also ging es heute Abend in den Valbyparken zur Aktivierung. Mit 5W an der DF-Vertikalantenne waren die ben\xF6tigen 10 QSO nach 10 Minuten geschafft und der Rest war K\xFCr. Am Ende 37 QSOs auf 3 B\xE4ndern in einer knappen Stunde und sogar ein wenig DX dabei.</p><p><img src="'+f+'" alt="Bilder des Monats"><img src="'+w+'" alt="Bilder des Monats"><img src="'+z+'" alt="Bilder des Monats"></p><p>Am 10.11. hat Harm, DK4HAA, den Duvenstedter Brook, POTA-Referenz DE-0719, aktiviert. Bei herbstlichen 6 Grad bot sich der Spot mit Bank und Tisch an, da nur wenige Spazierg\xE4nger im Park unterwegs waren. Das 20m-Band war &quot;on fire&quot; und so kamen in knapp 15 Minuten im Pileup \xFCber 30 QSOs zusammen. Nach einer kurzen Verschnaufpause folgte weitere 10 auf 40m und 15m inkl. einiger DF2DF-Kontakte.</p><p><img src="'+j+'" alt="Bilder des Monats"><img src="'+A+'" alt="Bilder des Monats"><img src="'+S+'" alt="Bilder des Monats"><img src="'+P+'" alt="Bilder des Monats"><img src="'+E+'" alt="Bilder des Monats"><img src="'+T+'" alt="Bilder des Monats"><img src="'+K+'" alt="Bilder des Monats"><img src="'+O+'" alt="Bilder des Monats"></p><p>Sven, DL7PIP, konnte heute im Naturschutzgebiet Olleroh in Dortmund nicht nur die POTA Referenz DE-0496 mit 16 QSOs auf dem 20m Band in nur 8 Minuten aktivieren, sondern auch die wundersch\xF6nen, herbstlichen Farben dieses kleinen Waldst\xFCckes nahe der Autobahn A45 genie\xDFen.</p><p><img src="'+N+'" alt="Bilder des Monats"><img src="'+F+'" alt="Bilder des Monats"><img src="'+L+'" alt="Bilder des Monats"><img src="'+H+'" alt="Bilder des Monats"><img src="'+W+'" alt="Bilder des Monats"><img src="'+G+'" alt="Bilder des Monats"><img src="'+R+'" alt="Bilder des Monats"><img src="'+V+'" alt="Bilder des Monats"></p><p>Am Sonntag den 3.11. haben wir Rosi DG5YL und ich DG6LP in Dortmund den Emscherweg DE-0836 bei sch\xF6nstem Novemberwetter aktiviert. Nachdem wir die Antenne im Geb\xFCsch versteckt haben, fingen wir auf 17m an. Die erforderlichen 10 QSOs waren nach wenigen Minuten im Log und so haben wir uns durch die B\xE4nder gearbeitet. Am Ende der Aktivierung nach ca 3,5 Std standen f\xFCr mich 34 QSOs und f\xFCr Rosi 99 QSOs im Log, ausschlie\xDFlich in SSB. Dann ging es schnell nach Hause und die Akkus laden f\xFCr den bevorstehenden Urlaub auf Borkum am n\xE4chsten Tag. Gearbeitet haben wir nur mit unserem Pota-Rucksack: eine DF vertikal Antenne, ICOM IC-705 mit nachgeschalteter Micro-PA und 3x 6Ah Eremit Akkus.</p><p>vy 73 Markus DG6LP &amp; Rosi DG5YL</p><p><img src="'+Q+'" alt="Bilder des Monats"><img src="'+I+'" alt="Bilder des Monats"><img src="'+C+'" alt="Bilder des Monats"><img src="'+U+'" alt="Bilder des Monats"><img src="'+Z+'" alt="Bilder des Monats"><img src="'+q+'" alt="Bilder des Monats"><img src="'+x+'" alt="Bilder des Monats"></p><p>Am heutigen 14.11. hat Sven, DL7PIP, den Seepark in L\xFCnen, Parkreferenz DE-0334, mit insgesamt 41 SSB QSOs aktiviert. Im Sommer bei sch\xF6nem Wetter schon fast \xFCberlaufen, pr\xE4sentiert sich der Park um diese Jahreszeit angenehm leer und in wundersch\xF6nen, herbstlichen Farben. Gearbeitet wurde mit einem Yaesu FT-891 mit 50W Ausgangsleistung und einer JPC-12 Antenne auf 3 Kurzwellen B\xE4ndern. Die weiteste Verbindung wurde dabei mit einer Station auf Puerto Rico hergestellt.</p><p><img src="'+y+'" alt="Bilder des Monats"><img src="'+J+'" alt="Bilder des Monats"><img src="'+Y+'" alt="Bilder des Monats"><img src="'+X+'" alt="Bilder des Monats"><img src="'+$+'" alt="Bilder des Monats"><img src="'+ee+'" alt="Bilder des Monats"><img src="'+ie+'" alt="Bilder des Monats"><img src="'+te+'" alt="Bilder des Monats"></p><p>2 Wochen Urlaub auf Borkum</p><p>Hinter Rosi DG5YL &amp; Markus DG6LP liegen 2 erholsame Wochen Urlaub auf Borkum mit 7 erfolgreichen Aktivierungen des Nationalparks nieders\xE4chsisches Wattenmeer DE-0094. Insgesamt kamen 564 QSOs in unser Log. Gearbeitet wurde ausschlie\xDFlich in SSB auf den B\xE4ndern 10m, 20m und 40m. Die Highlights der Verbindungen gingen nach Alaska, Puerto Rico, Costa Rica und Wyoming/USA. Mit dabei hatten wir unseren Pota Rucksack mit dem IC-705, der kleinen Micro-PA 50+ und der DF vertikal Antenne. Die abendlichen Aktivierungen fallen in die Rubrik &quot;Gl\xFChwein-POTA&quot;, welche die Temperaturen von 5\xB0C bei einem nicht endenden Pileup gerade aus den USA ertr\xE4glich machten. Besonders erfreulich ist, das selbst seltene Stationen wie zB aus Costa Rica auf unseren CQ Ruf gekommen sind. Gerade wegen des doch einfachen Equipments macht es doch ein wenig stolz.</p><p>vy 73,44 de Rosi DG5YL &amp; Markus DG6LP</p><p><img src="'+ne+'" alt="Bilder des Monats"><img src="'+ae+'" alt="Bilder des Monats"><img src="'+re+'" alt="Bilder des Monats"><img src="'+se+'" alt="Bilder des Monats"><img src="'+de+'" alt="Bilder des Monats"><img src="'+oe+'" alt="Bilder des Monats"><img src="'+le+'" alt="Bilder des Monats"><img src="'+me+'" alt="Bilder des Monats"><img src="'+ge+'" alt="Bilder des Monats"></p><p>Am 16.11. haben Tobias (DC1TC) und Harm (DK4HAA) den Th\xF6rls Park in Hamburg (POTA DE-0261) und die beiden Fernwanderwege E1 und E9 (DE-0558, DE-0622) aktiviert. Neben dem \xFCblichen KW-Equipment kamen einige Kontakte auf dem 2m-Band ins Log. Auf der Kurzwelle war das 40m-Band etwas leise, es kamen aber stetig QSOs in Log. Ein Wechsel auf 20m brachte dann noch mal einen Pileup und viele Stationen aus Europa ins Log. Zus\xE4tzlich meldete sich ein Hunter aus Indonesien rein und wurde mit soliden 57/55 ins Log aufgenommen. Viele P2P- und DF2DF-Kontakte rundeten die Aktivierung ab.</p><p><img src="'+ue+'" alt="Bilder des Monats"><img src="'+pe+'" alt="Bilder des Monats"><img src="'+ce+'" alt="Bilder des Monats"><img src="'+he+'" alt="Bilder des Monats"></p><p>Den 16.11. nutzte Philipp (DO8PHK), um in den Niederlanden zwischen Venlo und Eindhoven insgesamt 7 verschiedene Parks auf dem 20m-Band zu aktivieren - etwas, das f\xFCr Klasse E-Inhaber*innen zuhause nicht m\xF6glich ist. Viele der Parks waren per SSB oft in weniger als 20 Minuten aktiviert. Nur der letzte Park erwies sich bei einbrechender Dunkelheit als z\xE4h: Hier brauchte es am Ende einige Digimode-QSOs um auch den siebten Park als aktiviert abzuhaken. Auch wenn der Himmel grau und die Temperaturen mit 7 Grad nicht allzu einladend waren, hat sich der Weg in die Natur gelohnt. Eine Thermoskanne mit hei\xDFem Tee und diverse Pile-Ups lie\xDFen die K\xE4lte schnell vergessen.</p><p><img src="'+_e+'" alt="Bilder des Monats"><img src="'+ke+'" alt="Bilder des Monats"><img src="'+ve+'" alt="Bilder des Monats"><img src="'+Be+'" alt="Bilder des Monats"></p><p>Am 17.11. haben Peter (DL6PL), Brigitte (DC3BR), Mladen (auf dem Weg zur Lizenz) und Harm (DK4HAA) die Elbe in Hamburg aufgesucht und den dortigen Falkensteiner Wald- und Uferpark (POTA DE-0134) sowie die angrenzenden Trails Jakobsweg Via Baltica &amp; Birgittaweg (DE-0604) und Elberadweg (DE-0817) aktiviert. Mit dem Mobilger\xE4t kamen f\xFCr uns auf 2m einige POTA-QSOs zusammen, wobei der steile Hang entlang der Elbe Verbindungen nach Norden unm\xF6glich machte. Wechselhaftes Wetter brachte uns zwischendurch den ein oder anderen Schauer, der im Anschluss direkt von Sonnenschein abgel\xF6st wurde. Auf Kurzwelle wurden das 20- und 40-Meter Band bespielt. Der Pileup auf 20m hielt fast eine Stunde lang an. Auf 40m machte Mladen im Ausbildungsbetrieb die ersten Gehversuche auf Kurzwelle und meisterte die Aktivierung tadellos. Unz\xE4hlige Drau\xDFenfunker-Kontakte kamen ins Log. Mit einsetzendem Dauerregen packten wir unsere Stationen zusammen und machten uns auf dem Weg zur\xFCck zur S-Bahn-Station Blankenese. Nass aber gl\xFCcklich und erfolgreich beendeten wir diese Aktivierung. Harm hat mit dieser Aktivierung sein pers\xF6nliches Ziel erreicht, alle Hamburger POTA-Parks in 2024 mindestens einmal erfolgreich aktiviert zu haben. Au\xDFerdem wurde die Marke von 3000 Aktivierungs-QSOs geknackt.</p><p><img src="'+Me+'" alt="Bilder des Monats"><img src="'+De+'" alt="Bilder des Monats"><img src="'+be+'" alt="Bilder des Monats"><img src="'+fe+'" alt="Bilder des Monats"><img src="'+we+'" alt="Bilder des Monats"><img src="'+ze+'" alt="Bilder des Monats"><img src="'+je+'" alt="Bilder des Monats"><img src="'+Ae+'" alt="Bilder des Monats"><img src="'+Se+'" alt="Bilder des Monats"><img src="'+Pe+'" alt="Bilder des Monats"></p><p>Heute habe ich mich mal auf den Weg gemacht um die beiden Parks zu aktivieren:</p><ul><li>DE-0192 Saar-Regionalpark und</li><li>DE-0693 Biosph\xE4re Bliesgau Biosphere Reserve, der auch zeitgleich zum WWFF Programm geh\xF6rt und unter DLFF-0033 gef\xFChrt wird.</li></ul><p>Ich habe in ca. 1,5 Std., 49 QSOs gearbeitet.</p><p>Es war ein wundersch\xF6ner Tag und hat spa\xDF gemacht.</p><p>Gr\xFC\xDFe aus dem Saarland DA6TW (Torsten)</p><p><img src="'+Ee+'" alt="Bilder des Monats"><img src="'+Te+'" alt="Bilder des Monats"><img src="'+Ke+'" alt="Bilder des Monats"></p><p>Ein Temperatursprung von Minus-Graden auf 2 Stellige Plus-Grade und das in der Voreifel. Also hat Markus (DG6KP) sich mit dem Fahrrad auf den Weg gemacht, um den n\xE4chstgelegenen Park zu aktivieren. DE-0429 Erftauen National Recreation Area liegt vollst\xE4ndig in DE-0048 Rheinland Nature Park, so dass das auch gleich ein 2fer ist. Da es sehr st\xFCrmte, hatte ich den Park fast f\xFCr mich alleine und konnte die H\xFCtte mit Tisch nutzen. Zumindest wollte sich von den wenigen Besuchern niemand dort hinsetzen. Zum Einsatz kam erstmalig das &quot;kleine Besteck&quot;, ein (tr)usdx mit einem alten Android-Tablet, auf dem FT8CN l\xE4uft. Das Tablet braucht nur eine USB-Verbindung zum (tr)usdx. Das ganze an der DF-EFWH, die zwischen einem Baum und der H\xFCtte gespannt war. Innerhalb einer guten halben Stunde standen 11 QSO auf 20m FT8 im Log, was zeigt, dass es grunds\xE4tzlich funktioniert. Versuche ein paar P2P Verbindungen in SSB zu machen scheiterten leider, da ich die Gegenstationen nicht h\xF6ren konnte. Trotzdem eine erfolgreiche Aktivierung.</p><p><img src="'+Oe+'" alt="Bilder des Monats"><img src="'+Ne+'" alt="Bilder des Monats"><img src="'+Fe+'" alt="Bilder des Monats"><img src="'+Le+'" alt="Bilder des Monats"></p><p>DB6NL hat heute mal wieder einen freien Tag im Sauerland verbracht. Zuerst wurde der Wilzenberg (DM/NW-207) aktiviert. Da es noch ganz sch\xF6n regnete, mussten 4 Pflicht-QSOs auf 15m reichen. Danach ging es auf die Ziegenhelle (DM/NW-185). da es trocken blieb war in der Sonne Zeit f\xFCr mehr Betrieb. Es kamen 5 P2P und ein DF2DF-QSO mit DO1EDK ins Log und es war ebenfalls Zeit f\xFCr einen Kaffee. Zum Abschluss wurde der Kahle Asten (DM/NW-026) aktiviert. Auf 20m gegen Nachmittag eine schnelle Nummer mit Kontakten in ganz Europa. F\xFCr den Park DE-0054 kamen bei auch insgesamt 47 g\xFCltige QSO ins Log, f\xFCr Sota konnten 22 mountain goat Punkte geholt werden.</p><p><img src="'+He+'" alt="Bilder des Monats"><img src="'+We+'" alt="Bilder des Monats"><img src="'+Ge+'" alt="Bilder des Monats"><img src="'+Re+'" alt="Bilder des Monats"><img src="'+Ve+'" alt="Bilder des Monats"><img src="'+Qe+'" alt="Bilder des Monats"></p><p>Samstag Morgen kurz vor 8 Uhr. Das Thermometer sagt -2*C, der Himmel strahlt blau, die Sonne geht gleich auf. Bester Zeitpunkt f\xFCr Verbindung Richtung Osten. Und so schnappte ich, DO3OI mir den Rucksack und zog los in die Referenz DE-0534. Schnell einen Draht in den Busch geworfen, Akku angeschlossen und schon konnte es losgehen. Dachte ich.</p><p>Denn bin ich schon seit einem Jahr hier in diesem Park regelm\xE4\xDFig aktiv und dennoch kam ich heute nicht im geplanten Ma\xDFe dazu Betrieb zu machen, da viele Spazierg\xE4nger Interesse zeigten. Und da liegt es ja auch an mir und an uns Draussenfunkern dieses Hobby mit genau so viel Herzblut zu vermitteln wie es uns bewegt.</p><p>Es hat daher vor lauter Gespr\xE4chen abseits des Mikrofons f\xFCr keine Aktivierung vor dem Fr\xFChst\xFCck gereicht, aber der Tag war ja noch jung. Im Laufe des Tages ging es weiter.</p><p><img src="'+Ie+'" alt="Bilder des Monats"></p><p>Am 9.11. aktivierte DM5WK zwei Parks: zuerst den Wasserpark Dove Elbe DE-0135, dann die Hamburger Seite H\xF6ltigbaum DE-0537. Die Temperaturen war schon recht frisch, so dass es nach 45 bzw. 30 Minuten zu kalt wurde. Trotzdem kamen rund 40 Kontakte zustande, davon neun P2P. Einer davon mit Nord-Mazedonien. Gl\xFCcklicherweise gab es auch wieder einige Kontakte mit anderen Drau\xDFenfunkern. Bei den normalen Kontakten war Kanada und die Azoren dabei. Ein nettes Pl\xE4tzchen ist der &quot;POTA-Schreibtisch&quot; im H\xF6ltigbaum, den bestimmt andere OPs auf die gleiche Art zum Funken verwendet haben.</p><p><img src="'+Ce+'" alt="Bilder des Monats"></p>',40);function ai(ri,si){const t=o("ExternalLinkIcon");return r(),s("div",null,[Ze,i("p",null,[qe,i("a",xe,[ye,n(t)]),Je,i("a",Ye,[Xe,n(t)]),$e,i("a",ei,[ii,n(t)]),ti]),ni])}var oi=a(Ue,[["render",ai],["__file","2024-11-30-Bilder-Des-Monats-November.html.vue"]]);export{oi as default};
